for data in json_str['geofieldMap']['cwinmap-page']['data']['geometries']:
    try:
        index_html = data['properties']['description']
        index_html = index_html.replace('\r','')
        num = re.search('.*?href.*?node.*?(\d+)"',index_html,re.S).group(1)
        url = 'http://www.waste-cwin.org/node/'+num
        url_list.append(url)
        print(url)
    except:
        pass
